import { Component } from 'react';


class MovieCard extends Component {
    render() {
        return (
            <div className="movie-card" style = {{img}}>
                {this.props.title}
                <img src={this.props.posterSrc} />
                {this.props.genres}
            </div>
        )
    }

}

export default MovieCard;
